INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (7, 0.0, "2030/12/17 14:59:59", 1, -363.0, 1, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", 106001, 0, 7001, 0, 1, "2015/12/17 15:00:00", "キャル", 0.0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (7, 0.0, "2030/12/17 14:59:59", 1, -363.0, 1, "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", 105901, 0, 7002, 0, 1, "2015/12/17 15:00:00", "コッコロ", 0.0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (7, 0.0, "2030/12/17 14:59:59", 1, -363.0, 1, "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", 105801, 0, 7003, 0, 1, "2015/12/17 15:00:00", "ペコリーヌ", 0.0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (10, 0.0, "2030/12/17 14:59:59", 1, -363.0, 1, "ジュエルを食べ物…\nいえ、貴重品と交換できます！", 105801, 0, 10001, 0, 1, "2015/12/17 15:00:00", "ペコリーヌ", 0.0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (10, 0.0, "2030/12/17 14:59:59", 1, -363.0, 1, "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", 106001, 0, 10002, 0, 1, "2015/12/17 15:00:00", "キャル", 0.0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (10, 0.0, "2030/12/17 14:59:59", 1, -363.0, 1, "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", 105901, 0, 10003, 0, 1, "2015/12/17 15:00:00", "コッコロ", 0.0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (10, 0.0, "2030/12/17 14:59:59", 1, -363.0, 1, "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", 106401, 2104010, 10004, 0, 2, "2015/12/17 15:00:00", "シェフィ", 0.0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (12, 0.0, "2030/12/17 14:59:59", 1, -416.5, 1, "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", 105801, 0, 12001, 0, 1, "2015/12/17 15:00:00", "ペコリーヌ", 0.0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (13, 0.0, "2030/12/17 14:59:59", 1, -363.0, 1, "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", 106001, 0, 13001, 0, 1, "2015/12/17 15:00:00", "キャル", 0.0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (13, 0.0, "2030/12/17 14:59:59", 1, -363.0, 1, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", 105901, 0, 13002, 0, 1, "2015/12/17 15:00:00", "コッコロ", 0.0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (13, 0.0, "2030/12/17 14:59:59", 1, -363.0, 1, "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", 106401, 2104010, 13003, 0, 2, "2015/12/17 15:00:00", "シェフィ", 0.0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (13, 0.0, "2030/12/17 14:59:59", 1, -363.0, 1, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", 105801, 0, 13004, 0, 1, "2015/12/17 15:00:00", "ペコリーヌ", 0.0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (14, 0.0, "2030/12/17 14:59:59", 1, -363.0, 1, "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", 105901, 0, 14001, 0, 1, "2015/12/17 15:00:00", "コッコロ", 0.0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (14, 0.0, "2030/12/17 14:59:59", 1, -363.0, 1, "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", 106401, 2104010, 14002, 0, 2, "2015/12/17 15:00:00", "シェフィ", 0.0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (14, 0.0, "2030/12/17 14:59:59", 1, -363.0, 1, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", 105801, 0, 14003, 0, 1, "2015/12/17 15:00:00", "ペコリーヌ", 0.0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (14, 0.0, "2030/12/17 14:59:59", 1, -363.0, 1, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", 106001, 0, 14004, 0, 1, "2015/12/17 15:00:00", "キャル", 0.0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (15, 0.0, "2030/12/17 14:59:59", 1, -470.0, 1, "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", 105901, 0, 15001, 0, 1, "2015/12/17 15:00:00", "コッコロ", 0.0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (16, 0.0, "2030/12/17 14:59:59", 1, -363.0, 1, "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", 106401, 2104010, 16001, 0, 2, "2015/12/17 15:00:00", "シェフィ", 0.0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (16, 0.0, "2030/12/17 14:59:59", 1, -363.0, 1, "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", 105801, 0, 16002, 0, 1, "2015/12/17 15:00:00", "ペコリーヌ", 0.0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (16, 0.0, "2030/12/17 14:59:59", 1, -363.0, 1, "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", 106001, 0, 16003, 0, 1, "2015/12/17 15:00:00", "キャル", 0.0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (16, 0.0, "2030/12/17 14:59:59", 1, -363.0, 1, "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", 105901, 0, 16004, 0, 1, "2015/12/17 15:00:00", "コッコロ", 0.0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (17, 0.0, "2030/12/17 14:59:59", 1, -363.0, 1, " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", 105901, 0, 17002, 0, 1, "2015/12/17 15:00:00", "コッコロ", 0.0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (25, 0.0, "2030/12/17 14:59:59", 1, -363.0, 1, "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", 106001, 0, 17004, 0, 1, "2015/12/17 15:00:00", "キャル", 0.0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (25, 0.0, "2030/12/17 14:59:59", 1, -363.0, 1, "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", 105901, 0, 17005, 0, 1, "2015/12/17 15:00:00", "コッコロ", 0.0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (25, 0.0, "2030/12/17 14:59:59", 1, -363.0, 1, "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ", 106401, 2104010, 17006, 0, 2, "2015/12/17 15:00:00", "シェフィ", 0.0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (25, 0.0, "2030/12/17 14:59:59", 1, -363.0, 1, "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", 105801, 0, 17007, 0, 1, "2015/12/17 15:00:00", "ペコリーヌ", 0.0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (18, 0.0, "2030/12/17 14:59:59", 1, -363.0, 1, "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", 190801, 0, 18001, 0, 1, "2015/12/17 15:00:00", "カリン", 0.0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (18, 0.0, "2030/12/17 14:59:59", 2, -363.0, 1, "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！", 190801, 0, 18002, 0, 1, "2015/12/17 15:00:00", "カリン", 0.0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (19, 0.0, "2030/12/17 14:59:59", 3, -470.0, 1, "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね", 190801, 0, 19001, 0, 1, "2015/12/17 15:00:00", "カリン", 0.0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (19, 0.0, "2030/12/17 14:59:59", 4, -470.0, 1, "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪", 190801, 0, 19002, 0, 1, "2015/12/17 15:00:00", "カリン", 0.0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (20, 0.0, "2030/12/17 14:59:59", 5, -470.0, 1, "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", 190801, 0, 20001, 0, 1, "2015/12/17 15:00:00", "カリン", 0.0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (20, 0.0, "2030/12/17 14:59:59", 6, -470.0, 1, "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", 190801, 0, 20002, 0, 1, "2015/12/17 15:00:00", "カリン", 0.0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (21, 0.0, "2030/12/17 14:59:59", 1, -363.0, 1, "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", 106001, 0, 21001, 0, 1, "2015/12/17 15:00:00", "キャル", 0.0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (21, 0.0, "2030/12/17 14:59:59", 1, -363.0, 1, "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", 105901, 0, 21002, 0, 1, "2015/12/17 15:00:00", "コッコロ", 0.0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (21, 0.0, "2030/12/17 14:59:59", 1, -363.0, 1, "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう", 106401, 2104010, 21003, 0, 2, "2015/12/17 15:00:00", "シェフィ", 0.0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (21, 0.0, "2030/12/17 14:59:59", 1, -363.0, 1, "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", 105801, 0, 21004, 0, 1, "2015/12/17 15:00:00", "ペコリーヌ", 0.0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (22, 0.0, "2030/12/17 14:59:59", 1, -430.0, 1, "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", 190801, 0, 22001, 0, 1, "2015/12/17 15:00:00", "カリン", 0.0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (22, 0.0, "2030/12/17 14:59:59", 2, -430.0, 1, "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", 190801, 0, 22002, 0, 1, "2015/12/17 15:00:00", "カリン", 0.0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (23, 0.0, "2030/12/17 14:59:59", 3, -430.0, 1, "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", 190801, 0, 23001, 0, 1, "2015/12/17 15:00:00", "カリン", 0.0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (23, 0.0, "2030/12/17 14:59:59", 4, -430.0, 1, "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", 190801, 0, 23002, 0, 1, "2015/12/17 15:00:00", "カリン", 0.0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (24, 8.0, "2030/12/17 14:59:59", 1, -385.0, 2, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", 109001, 0, 24001, 10011, 1, "2019/01/31 12:00:00", "エリコ（バレンタイン）", 4.08);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (24, 8.0, "2030/12/17 14:59:59", 2, -385.0, 2, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", 109001, 0, 24002, 10011, 1, "2019/01/31 12:00:00", "エリコ（バレンタイン）", 5.0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (24, 8.0, "2030/12/17 14:59:59", 3, -385.0, 2, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", 109001, 0, 24003, 10011, 1, "2019/01/31 12:00:00", "エリコ（バレンタイン）", 10.11);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (24, 8.0, "2030/12/17 14:59:59", 4, -385.0, 2, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", 109001, 0, 24004, 10011, 1, "2019/01/31 12:00:00", "エリコ（バレンタイン）", 4.0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (24, 8.0, "2030/12/17 14:59:59", 5, -385.0, 2, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", 109001, 0, 24005, 10011, 1, "2019/01/31 12:00:00", "エリコ（バレンタイン）", 6.0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (24, 0.0, "2030/12/17 14:59:59", 6, 0.0, 1, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 109002, 0, 24006, 10011, 1, "2019/01/31 12:00:00", "エリコ（バレンタイン）", 0.0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (24, 0.0, "2030/12/17 14:59:59", 7, 0.0, 1, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 109002, 0, 24007, 10011, 1, "2019/01/31 12:00:00", "エリコ（バレンタイン）", 0.0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (24, 0.0, "2030/12/17 14:59:59", 8, 0.0, 1, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 109002, 0, 24008, 10011, 1, "2019/01/31 12:00:00", "エリコ（バレンタイン）", 0.0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (24, 0.0, "2030/12/17 14:59:59", 9, 0.0, 1, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", 109002, 0, 24009, 10011, 1, "2019/01/31 12:00:00", "エリコ（バレンタイン）", 0.0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (24, 0.0, "2030/12/17 14:59:59", 10, 0.0, 1, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 109002, 0, 24010, 10011, 1, "2019/01/31 12:00:00", "エリコ（バレンタイン）", 0.0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (24, 8.0, "2030/12/17 14:59:59", 1, -385.0, 2, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", 109101, 0, 24011, 10011, 1, "2019/01/31 12:00:00", "シズル（バレンタイン）", 2.12);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (24, 8.0, "2030/12/17 14:59:59", 2, -385.0, 2, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", 109101, 0, 24012, 10011, 5, "2019/01/31 12:00:00", "シズル（バレンタイン）", 4.19);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (24, 8.0, "2030/12/17 14:59:59", 3, -385.0, 4, "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", 109101, 0, 24013, 10011, 2, "2019/01/31 12:00:00", "シズル（バレンタイン）", 2.3);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (24, 0.0, "2030/12/17 14:59:59", 4, 0.0, 1, "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", 109102, 0, 24014, 10011, 1, "2019/01/31 12:00:00", "シズル（バレンタイン）", 0.0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (24, 8.0, "2030/12/17 14:59:59", 5, -385.0, 2, "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", 109101, 0, 24015, 10011, 5, "2019/01/31 12:00:00", "シズル（バレンタイン）", 5.23);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (24, 0.0, "2030/12/17 14:59:59", 6, 0.0, 1, "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", 109102, 0, 24016, 10011, 1, "2019/01/31 12:00:00", "シズル（バレンタイン）", 0.0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (24, 8.0, "2030/12/17 14:59:59", 7, -385.0, 2, "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", 109101, 0, 24017, 10011, 1, "2019/01/31 12:00:00", "シズル（バレンタイン）", 5.01);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (24, 0.0, "2030/12/17 14:59:59", 8, 0.0, 1, "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", 109102, 0, 24018, 10011, 1, "2019/01/31 12:00:00", "シズル（バレンタイン）", 0.0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (24, 0.0, "2030/12/17 14:59:59", 9, 0.0, 1, "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", 109102, 0, 24019, 10011, 1, "2019/01/31 12:00:00", "シズル（バレンタイン）", 0.0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (24, 0.0, "2030/12/17 14:59:59", 10, 0.0, 1, "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪", 109102, 0, 24020, 10011, 1, "2019/01/31 12:00:00", "シズル（バレンタイン）", 0.0);
